import React from "react";
import "../style/main.css";

function Main() {
  return (
    <div className="main-container">
      <div className="description-box">
        <h1>Bienvenue dans l'univers</h1>
        <p>Plus tard, cette section affichera une description détaillée avec des images et d'autres éléments intéressants.</p>
      </div>
    </div>
  );
}

export default Main;
